import React from "react";
import { BrowserRouter } from "react-router-dom";
import Footer from "./Components/common/Footer";
import Header from "./Components/common/Header";
import CustomRoutes from "./router/CustomRoutes";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <CustomRoutes />
      <Footer />
    </BrowserRouter>
  );
}

export default App;
